import { Link } from "react-router-dom";
import { UseAuthContext } from "../hooks/UseAuthContext";
import { UseLogout } from '../hooks/UseLogout'

const Navbar = () => {
  const { logout } = UseLogout()
  const {user} = UseAuthContext()


  const handleClick = () => {
    // console.log('Logout clicked')
    // localStorage.removeItem('user')
    
    
    // dispatch({type:"LOGOUT"})
    logout()
  }

    return ( 
        <div className="container-lg">
        <nav className="navbar navbar-expand-lg bg-light">
<div className="container-fluid">
 <Link className="navbar-brand" to="/">Feel The Code</Link>
 <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
   <span className="navbar-toggler-icon"></span>
 </button>
 <div className="collapse navbar-collapse" id="navbarSupportedContent">
   <ul className="navbar-nav me-auto mb-2 mb-lg-0">
     <li className="nav-item">
       <Link className="nav-link active" aria-current="page" to={`/#about`}>About</Link>
     </li>

     <li className="nav-item">
       <Link className="nav-link" to="/products">Products</Link>
     </li>

   </ul>
   
    {user && (
      <div>
          <span className="nav-item me-2">{user.email}</span>
          <button className="btn btn-outline-success" onClick={handleClick}>Log out</button>
      </div>
    )}
    {!user && (
      <form className="d-lg-flex d-none " role="search">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0">
         <li className="nav-item">
           <Link className="nav-link" to="/login">Login</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to="/signup">SignUp</Link>
         </li>

      </ul>
      </form>
    )}
   

 </div>
</div>
</nav>
</div>
     );
}
 
export default Navbar;
